import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Modal } from 'react-bootstrap';
import { FaEdit, FaTrashAlt } from 'react-icons/fa';
import MasterAgentForm from './MasterAgentForm';
import SubAgentList from './SubAgentList';
import '../styles/Dashboard.css';

const Dashboard = () => {
  const [masterAgents, setMasterAgents] = useState([]);
  const [selectedMasterAgent, setSelectedMasterAgent] = useState(null);
  const [showForm, setShowForm] = useState(false);
  const [formType, setFormType] = useState('Add'); // 'Add' or 'Edit'
  const [currentAgent, setCurrentAgent] = useState(null);

  useEffect(() => {
    loadMasterAgents();
  }, []);

  const loadMasterAgents = async () => {
    try {
      const result = await axios.get('http://localhost:5001/api/master-agents');
      setMasterAgents(result.data);
    } catch (error) {
      console.error('Error loading master agents:', error);
    }
  };

  const handleShowForm = (type = 'Add', agent = null) => {
    setFormType(type);
    setCurrentAgent(agent);
    setShowForm(true);
  };

  const handleCloseForm = () => {
    setShowForm(false);
    loadMasterAgents();
  };

  const handleDeleteAgent = async (agentId) => {
    try {
      await axios.delete(`http://localhost:5001/api/master-agents/${agentId}`);
      loadMasterAgents();
    } catch (error) {
      console.error('Error deleting master agent:', error);
    }
  };

  return (
    <div className="container mt-5">
      <div className="header-section">
        <div className="create-agent-section">
          <h2>Create your first agent</h2>
          <p>Craft a unique AI agent of your own by uploading your data and effortlessly customizing its appearance and personality</p>
        </div>
      </div>
      <div className="main-section">
        <h1>Dashboard</h1>
        <div className="agent-list">
          <div className="agent-card add-master-agent" onClick={() => handleShowForm('Add')}>
            <div className="card-body">
              <p className="add-agent-text">+ Add Master Agent</p>
            </div>
          </div>
          {masterAgents.map(agent => (
            <div key={agent.MasterAgentId} className="agent-card">
              <div className="card-body">
                <h5 className="card-title">{agent.Name}</h5>
                <p className="card-text">{agent.Details}</p>
                <button
                  className="btn btn-primary"
                  onClick={() => setSelectedMasterAgent(agent.MasterAgentId)}
                >
                  View Sub Agents
                </button>
                <FaEdit
                  className="icon"
                  onClick={() => handleShowForm('Edit', agent)}
                />
                <FaTrashAlt
                  className="icon"
                  onClick={() => handleDeleteAgent(agent.MasterAgentId)}
                />
              </div>
            </div>
          ))}
        </div>
        {selectedMasterAgent && (
          <SubAgentList masterAgentId={selectedMasterAgent} />
        )}
      </div>

      {/* Modal for adding/editing Master Agent */}
      <Modal show={showForm} onHide={handleCloseForm}>
        <Modal.Header closeButton>
          <Modal.Title>{formType === 'Add' ? 'Add Master Agent' : 'Edit Master Agent'}</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <MasterAgentForm onAdd={handleCloseForm} agent={currentAgent} formType={formType} />
        </Modal.Body>
      </Modal>
    </div>
  );
};

export default Dashboard;
